import React from "react";
import { Link } from "react-router-dom";
import Game from "./Game";

function GameMenu(props) {
  return (
    <>
      <h2>Game Menu Page</h2>
      <ul>
        <li>
          <Link to={`/Game/`}>Points Per Game Questionaire</Link>
        </li>
        <li>
          <Link to="/Game">Assists Per Game Questionaire</Link>
        </li>
        <li>
          <Link to="/Game">Rebounds Per Game Questionaire</Link>
        </li>
        <li>
          <Link to="/Game">Steals Per Game Questionaire</Link>
        </li>
        <li>
          <Link to="/Game">Turnovers Per Game Questionaire</Link>
        </li>
      </ul>
    </>
  );
}

export default GameMenu;
